import logo from './logo.svg';
import './App.css';
import React from 'react';

class Tile extends React.Component {
  render() {
    return (
      <button className="Tile">

      </button>
    )
  }
}

class Board extends React.Component {
  constructor(props) {
    super(props)
    let generatedTiles=[]
    for(let row=0;row<9;row++) {
      for(let col=0;col<9;col++) {
        generatedTiles.push(Tile.render())
      }
    }
    this.state={
      boardTiles:generatedTiles
    };
  }
  render() {
    const x=this.state.boardTiles;
    return (
      {x}
    );
  }
}

class Game extends React.Component {
  render() {
    return (
      <div className="game">
        <div className="game-info">
          <h3>
            This is a big header
          </h3>
        </div>
        <div className="game-board">
          <Board />
        </div>

      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <div className="Game">
        <Game />
      </div>
    </div>
  );
}



export default App;
